SELECT  SUM(投资活动产生的现金流出小计) 
 FROM Cash_Flow_Statement 
 WHERE 年度 = '2021' AND 股票代码 = 32;

SELECT  筹资活动现金流入小计 
 FROM Cash_Flow_Statement 
 WHERE 年度 = '2021' AND 股票代码 = 40;

SELECT  经营活动现金流入小计 
 FROM Cash_Flow_Statement 
 WHERE 年度 = '2022' AND 股票代码 = 8;

SELECT  资产：其他非流动资产 
 FROM Balance_Sheet 
 WHERE 股票简称 = '深中华A' AND 截止日期 = '2021-12-31';

SELECT  股票代码, 年度, 支付的各项税费
 FROM Income_Statement
 WHERE 股票代码 = 1 AND 年度 = 2022;

SELECT  营业外收入 
 FROM Income_Statement 
 WHERE 年度 = '2021' AND 股票代码 = 5;

SELECT  (SUM(负债合计) - SUM(资产总计)) / SUM(资产总计) AS 净资产负债率
 FROM Balance_Sheet
 WHERE 股票简称 = '美丽生态' AND 截止日期 = '2022-12-31';

SELECT  股票简称, (营业总成本 / 营业总收入) AS 成本收入比
 FROM Income_Statement
 WHERE 股票简称 = '平安银行' AND 年度 = 2021;

SELECT  (SUM("资产总计") / SUM("负债合计")) AS "资产负债率"
 FROM Balance_Sheet
 WHERE "股票简称" = '深康佳A' AND "截止日期" = '2021-12-31';

SELECT  (SUM(负债合计) - SUM(资产总计)) / SUM(资产总计) AS 净资产负债率
 FROM Balance_Sheet
 WHERE 股票简称 = '美丽生态' AND 截止日期 = '2021-12-31';

SELECT (营业总收入 / ((资产：流动资产合计 + 资产：非流动资产合计) / 2)) AS 总资产周转率
 FROM Balance_Sheet
 WHERE 股票简称 = '神州数码';

SELECT (营业利润 / 资产总计) * 100 AS 总资产收益率
FROM Income_Statement
WHERE 股票简称 = '神州高铁' AND 年度 = 2021;
